import React from "react";
import Member from "./member/member";
import Grid from "@material-ui/core/Grid";
import logo from "../../resource/rice-university_logo.png";
import module from "./Team.module.css";

const Team = (props) => {
  var member = [
    { src: logo, name: "Jone Dow", intro: "qwerew" },
    { src: logo, name: "anonymous", intro: "qwerew" },
  ];

  return (
    <div className={module.body}>
          <Grid container spacing={3}>
      {member.map(element => (
      <Grid item xs={6} sm={4}>
        <Member src={element.src} name={element.name} intro={element.intro}/>
      </Grid>
      ))}
    </Grid>
    </div>
  );
};

export default Team;
